// src/components/Appartements.js
import React from 'react';

const Appartements = () => {
    return (
        <div>
            <h1>Liste des appartements à Montpellier</h1>
            <div>
                <h2>RIVES DU LEZ</h2>
                <p>⭐⭐⭐⭐⭐ - Excellent</p>
                <p>Par mois : 730 €</p>
            </div>
            <div>
                <h2>Barcel Raval</h2>
                <p>⭐⭐⭐⭐ - Good</p>
                <p>Hotel + Flight : 730 €</p>
            </div>
        </div>
    );
};

export default Appartements;
